import React from "react";
import SingleCard from "./SingleCard";
export default function Temporary(props) {
  // var obj = JSON.parse(props);
  // console.log(obj);
  // console.log(props.campaigns[0][0].email);
  const email = JSON.parse(localStorage.getItem("userEmail"));
  const filteredCampaign = props.campaigns[0].filter((element) => {
    return element.email === email;
  });
  // console.log(filteredCampaign[0])
  return (
    <div className="filter">
      <SingleCard campaigns={[filteredCampaign[0]]} />
    </div>
  );
}
